import React from 'react';

function QuestionCard({ questions }) {
  return (
    <div className="question-card">
      <h4>{questions.prompt}</h4>
      <ul>
        {questions.options.map((option, index) => (
          <li key={index}>{option}</li>
        ))}
      </ul>
    </div>
  );
}

export default QuestionCard;
